import './App.css';
import {bankOne} from './banks'

function App() {
  return (
    <div className="app">
        <div id="drum-machine">
          <h1>By Woody Gelius</h1>
          <div className="display">

              {bankOne.map(pad => (
                <p className='drum-pad'>{pad.keyTrigger}</p>
              ))}


          </div>
        </div>
    </div>
  );
}

export default App;
